Mommy Got Boobs - Mya Mayes in: She Wants To Be A Star - September 16th, 2011



mp4 h264 35min



Mya is the kind of Mom that would give her kids everything they ask 
for. Since her overindulged daughter wants to be a recording artist, 
she comes to ZZ Records for some professional guidance. For the label 
owner, Xander, talent is not an issue. As long as Mya can put in a 
superstar performance in the sack, Xander will go above and beyond 
the call of duty in turning her daughter into a superstar.



